import React, { Component } from "react";
import "./CardDot.css";
import SingleCard from "../Card/SingleCard";
export class CardDot extends Component {
  constructor(props) {
    super(props);
    this.state = {
      background: "#361C37",
      title: "First",
      link: "One",
      details: "Demo text"
    };
  }

  first() {
    this.setState({
      ...this.state,
      descrioption: "First",
      images: "One"
    });
  }

  second() {
    this.setState({
      ...this.state,
      descrioption: "Second.",
      images: "Two"
    });
  }

  third() {
    this.setState({
      ...this.state,
      descrioption: "Third.",
      images: "Three"
    });
  }

  fourth() {
    this.setState({
      ...this.state,
      descrioption: "Fourth.",
      images: "Four"
    });
  }
  render() {
    return (
      <div className="container">
        <div className="form-group row">
          <div className="col-md-1" />
          <div className="col-md-1 justify-content-center align-self-center">
            <button
              onMouseOver={() => this.fourth()}
              onClick={() => this.fourth()}
            >
              <span class="dot dotOne" />
            </button>
            <span class="dot dotTwo" />
            <span class="dot dotThree" />
            <span class="dot dotFour" />
          </div>
          <div className="col-md-3" />
          <div className="col-md-5">
            <SingleCard
              // background="#AB60B8"
              details="This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer."
              link="//www.gstatic.com/mobilesdk/160505_mobilesdk/discoverycards/2x/auth.png"
              title="This is third section"
              background="#AB60B8"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default CardDot;
